import React from 'react'
import './ExpensesList.css';
import ExpenseItem from './ExpenseItem';

const ExpensesList = props =>{
    {props.items.length === 0 ? <p>No Expenses to Display</p>:props.items.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}
      return <ul className='expenses'>

      </ul>

}

export default ExpensesList;
